style.css:
@-moz-document domain("habblet.city") {
.d-flex.flex-column.gap-2.align-items-center.justify-content-center.nitro-room-tools.p-2:hover {
    left: 30px;
    scale: 2;
}

.d-flex.flex-column.gap-2.align-items-center.justify-content-center.nitro-room-tools.p-2 {
    scale: 1;
    left: 10px;
    position: fixed;
    bottom: 300px;
    border-radius: 1rem;
    filter: drop-shadow(2px 4px 10px #00000091);
}


.d-flex.gap-2.align-items-center.justify-content-between.nitro-toolbar.py-1.px-3 {
    border-radius: 100px;
    box-shadow: none;
    border-top: none;
    border-bottom: none;
    width: auto;
    left: 50%;
    transform: translateX(-50%);
    bottom: 2px;
    filter: drop-shadow(2px 4px 10px #00000091);
}

.friend-bar .btn-primary, .friend-bar .btn-success {
    border-radius: 1rem;
}

.chatinput-container {
    border-radius: 100px !important
}

.nitro-notification-bubble {
    padding: 15px !important;
}

.rounded {
    border-radius: 1rem!important;
}

.btn-group-sm>.btn, .btn-sm {
    min-height: 28px;
    border-radius: 0.5rem;
}

.nitro-card {
  border-radius: 1rem !important
}

.nitro-room-chatinput-component .chatinput-container:before {
    display:none
}

.d-flex.align-items-center.justify-content-center.btn.btn-black.btn-sm.friend-bar-button {
    border-radius: 100px
}

.btn.btn-success.friend-bar-item {
    border-radius: 100px
}

.d-flex.nitro-purse.p-1 {
    margin-top: 2px;
    border-radius: 1rem;
    box-shadow: none;
}

.d-flex.w-100.justify-content-between.nitro-purse-seasonal-currency.fw-bold {
    box-shadow: none;
    border-radius: 1rem;
}

.nitro-room-chatinput-component {
    scale: 1;
    transition: ease 0.2s;
}

.nitro-room-chatinput-component:hover {
    scale: 1.5;
    transition: ease 0.3s;
  }

.nitro-purse-container .nitro-purse-seasonal-currency .currency-icon {
  border-radius: 1rem !important
}

.nitro-hotel-view {
height: calc(100%) !important;
}

.toolbar-home-bar-button .left {
  visibility: hidden
}

.toolbar-friend-bar-button .right {
  visibility: hidden
}
}
